import React, { useState } from 'react';

function Analytics() {
  const [filters, setFilters] = useState({
    location: '',
    qrId: '',
    browser: '',
    deviceType: '',
    os: '',
    repeatFrequency: ''
  });

  const [dropdownOpen, setDropdownOpen] = useState(false); // To handle the dropdown visibility
  const [selectedFilter, setSelectedFilter] = useState(null); // To store selected filter option

  const [selectedRows, setSelectedRows] = useState([]); // To keep track of selected rows

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  const handleFilterSelect = (filter) => {
    setSelectedFilter(filter);
    setDropdownOpen(false); // Close dropdown after selection
    console.log("Selected filter:", filter);
  };

  // Handle checkbox selection for rows
  const handleRowSelect = (event, rowId) => {
    if (event.target.checked) {
      setSelectedRows([...selectedRows, rowId]); // Add to selected rows
    } else {
      setSelectedRows(selectedRows.filter(id => id !== rowId)); // Remove from selected rows
    }
  };

  return (
    <div className="page-content">
      {/* start page title */}
      <div className="page-title-box">
        <div className="container-fluid">
          <div className="row align-items-center">
            <div className="col-sm-6">
              <div className="page-title">
                <h4>Analytics Table</h4>
              </div>
            </div>
            {/* Filter Dropdown on the right side */}
            <div className="col-sm-6 text-right">
              <div className="dropdown">
                <button
                  className="btn btn-secondary dropdown-toggle"
                  type="button"
                  id="filterDropdown"
                  aria-haspopup="true"
                  aria-expanded={dropdownOpen ? "true" : "false"}
                  onClick={toggleDropdown}
                >
                  Filter {selectedFilter ? `(${selectedFilter})` : ""}
                </button>
                <div className={`dropdown-menu ${dropdownOpen ? "show" : ""}`} aria-labelledby="filterDropdown">
                  <button className="dropdown-item" onClick={() => handleFilterSelect('Location')}>
                    Location
                  </button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('QR Code ID')}>
                    QR Code ID
                  </button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('Browser')}>
                    Browser
                  </button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('Device Type')}>
                    Device Type
                  </button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('Operating System')}>
                    Operating System
                  </button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('User Repeat Frequency')}>
                    User Repeat Frequency
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      {/* end page title */}

      {/* Table Section */}
      <div className="container-fluid">
        <div className="page-content-wrapper">
          <div className="row">
            <div className="col-12">
              <div className="card">
                <div className="card-body">
                  <div className="table-rep-plugin">
                    <div className="table-responsive mb-0" data-pattern="priority-columns">
                      <table id="analytics-table" className="table table-striped">
                        <thead>
                          <tr>
                            <th>
                              <input
                                type="checkbox"
                                onChange={(e) => {
                                  if (e.target.checked) {
                                    // Select all rows
                                    setSelectedRows([1, 2]); // Add logic here to select all rows
                                  } else {
                                    setSelectedRows([]); // Deselect all rows
                                  }
                                }}
                              />
                            </th>
                            <th>Location</th>
                            <th>IP Address</th>
                            <th>QR Code ID</th>
                            <th>Scan Time</th>
                            <th>Reference URL</th>
                            <th>Browser</th>
                            <th>Device Type</th>
                            <th>Operating System</th>
                            <th>User Repeat Frequency</th>
                          </tr>
                        </thead>
                        <tbody>
                          {/* Sample Data Row */}
                          <tr>
                            <td>
                              <input
                                type="checkbox"
                                checked={selectedRows.includes(1)}
                                onChange={(e) => handleRowSelect(e, 1)}
                              />
                            </td>
                            <td>New York, USA</td>
                            <td>192.168.0.1</td>
                            <td>QR12345</td>
                            <td>2024-11-08 10:30 AM</td>
                            <td>www.example.com/scan</td>
                            <td>Chrome</td>
                            <td>Mobile</td>
                            <td>Android 13</td>
                            <td>Once</td>
                          </tr>
                          <tr>
                            <td>
                              <input
                                type="checkbox"
                                checked={selectedRows.includes(2)}
                                onChange={(e) => handleRowSelect(e, 2)}
                              />
                            </td>
                            <td>London, UK</td>
                            <td>203.0.113.5</td>
                            <td>QR67890</td>
                            <td>2024-11-08 11:15 AM</td>
                            <td>www.example.com/scan</td>
                            <td>Safari</td>
                            <td>Desktop</td>
                            <td>macOS 12</td>
                            <td>Twice</td>
                          </tr>
                          {/* More rows as needed */}
                        </tbody>
                      </table>
                    </div>
                  </div>
                </div>
              </div>
            </div> {/* end col */}
          </div> {/* end row */}
        </div>
      </div> {/* container-fluid */}
    </div>
  );
}

export default Analytics;
